import React, {useState} from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const EditManageDevice = ({ userInfo, handleLogout }) => {
    const location = useLocation();
    // Check if location.state and dataItem exist
    const dataItem = location.state?.dataItem;    
    // alert(dataItem)

    const navigate = useNavigate();

    const backManageDevice = () => {
        navigate('/superadmin/ManageDevice');
    };

    // Update profile
    const [chargerID, setChargerID] = useState('');
    const [transactionID, setTransactionID] = useState('');
    const [tagID, setTagID] = useState('');
    const [model, setModel] = useState('');
    const [type, setType] = useState('');
    const [vendor, setVendor] = useState('');
    const [gunConnetor, setGunConnetor] = useState('');
    const [maxCurrent, setMaxCurrent] = useState('');
    const [maxPower, setMaxPower] = useState('');
    const [socketCount, setsocketCount] = useState('');
    const [currentOrActiveUser, setCurrentOrActiveUser] = useState('');
    const [ip, setIP] = useState('');
    const [lat, setLat] = useState('');
    const [long, setLong] = useState('');
    const [shortDescription, setShortDescription] = useState('');
    const [chargerAccessibility, setChargerAccessibility] = useState('');
    const [unitPrice, setUnitPrice] = useState('');
    const [assignedUser, setAssignedUser] = useState('');
    const [assignedResellerID, setAssignedResellerID] = useState('');
    const [assignedClientID, setAssignedClientID] = useState('');
    const [wifiPassword, setWifiPassword] = useState('');
    const [createdDate, setCreatedDate] = useState('');
    const [createdBy, setCreatedBy] = useState('');
    const [modifiedDate, setModifiedDate] = useState('');
    const [modifiedBy, setModifiedBy] = useState('');
    const [status, setStatus] = useState('');
    const [errorMessage, setErrorMessage] = useState('');

    const addManageDevice = async (e) => {
        alert(  JSON.stringify({ chargerID, transactionID, tagID, model, type, vendor, gunConnetor, maxCurrent, maxPower, socketCount,  currentOrActiveUser, ip, lat, long, shortDescription, chargerAccessibility, 
            unitPrice, assignedUser, assignedResellerID, assignedClientID, wifiPassword, createdDate, createdBy, modifiedDate, modifiedBy, status }), 'add charger all data' );
        e.preventDefault();
        try {
            const response = await fetch('http://192.168.1.70:9090/GetAllinputData', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ chargerID, transactionID, tagID, model, type, vendor, gunConnetor, maxCurrent, maxPower, socketCount,  currentOrActiveUser, ip, lat, long, shortDescription, chargerAccessibility, 
                unitPrice, assignedUser, assignedResellerID, assignedClientID, wifiPassword, createdDate, createdBy, modifiedDate, modifiedBy, status }),
            });
            alert(  JSON.stringify({ chargerID, transactionID, tagID, model, type, vendor, gunConnetor, maxCurrent, maxPower, socketCount,  currentOrActiveUser, ip, lat, long, shortDescription, chargerAccessibility, 
                unitPrice, assignedUser, assignedResellerID, assignedClientID, wifiPassword, createdDate, createdBy, modifiedDate, modifiedBy, status }), 'add charger all data' );
            if (response.ok) {
                alert('Charger added successfully');
                // Clear the input after successful submission if needed
                setChargerID(''); 
                setTransactionID(''); 
                setTagID(''); 
                setModel(''); 
                setType(''); 
                setVendor(''); 
                setGunConnetor(''); 
                setMaxCurrent(''); 
                setMaxPower(''); 
                setsocketCount(''); 
                setCurrentOrActiveUser(''); 
                setIP(''); 
                setLat(''); 
                setLong(''); 
                setShortDescription(''); 
                setChargerAccessibility(''); 
                setUnitPrice(''); 
                setAssignedUser(''); 
                setAssignedResellerID(''); 
                setAssignedClientID(''); 
                setWifiPassword(''); 
                setCreatedDate(''); 
                setCreatedBy(''); 
                setModifiedDate(''); 
                setModifiedBy(''); 
                setStatus(''); 
            } else {
                setErrorMessage('Failed to add charger');
            }
        }catch (error) {
                setErrorMessage('An error occurred while adding the charger');
                console.error('Error:', error);
        }
    };
    // Add Chargers end
    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Edit Manage Device</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={backManageDevice}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-12 grid-margin">
                                            <div class="card">
                                                <div class="card-body">
                                                    <h4 class="card-title">Manage Device</h4>
                                                    <form class="form-sample" onSubmit={addManageDevice}>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Charger ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Charger ID" value={chargerID}  onChange={(e) => setChargerID(e.target.value)} readOnly required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Transaction ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Transaction ID" value={transactionID}  onChange={(e) => setTransactionID(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Tag ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Tag ID" value={tagID}  onChange={(e) => setTagID(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Model</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Model" value={model}  onChange={(e) => setModel(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Type</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Type" value={type}  onChange={(e) => setType(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Vendor</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Vendor" value={vendor}  onChange={(e) => setVendor(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Gun Connetor</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Gun Connetor" value={gunConnetor}  onChange={(e) => setGunConnetor(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Max Current</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Max Current" value={maxCurrent}  onChange={(e) => setMaxCurrent(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Max Power</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Max Power" value={maxPower}  onChange={(e) => setMaxPower(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Socket Count</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Socket Count" value={socketCount}  onChange={(e) => setsocketCount(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Current or Active User</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Current or Active User" value={currentOrActiveUser}  onChange={(e) => setCurrentOrActiveUser(e.target.value)} readOnly required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">IP</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="IP" value={ip}  onChange={(e) => setIP(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Lat</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Lat" value={lat}  onChange={(e) => setLat(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Long</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Long" value={long}  onChange={(e) => setLong(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Short Description</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Short Description" value={shortDescription}  onChange={(e) => setShortDescription(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Charger Accessibility</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Charger Accessibility" value={chargerAccessibility}  onChange={(e) => setChargerAccessibility(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Unit Price</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Unit Price" value={unitPrice}  onChange={(e) => setUnitPrice(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Assigned User</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Assigned User" value={assignedUser}  onChange={(e) => setAssignedUser(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Assigned Reseller ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Assigned Reseller ID" value={assignedResellerID}  onChange={(e) => setAssignedResellerID(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Assigned Client ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Assigned Client ID" value={assignedClientID}  onChange={(e) => setAssignedClientID(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Wifi Password</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Wifi Password" value={wifiPassword}  onChange={(e) => setWifiPassword(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Created Date</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Created Date" value={createdDate}  onChange={(e) => setCreatedDate(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Created By</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Created By" value={createdBy}  onChange={(e) => setCreatedBy(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Modified Date</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Modified Date" value={modifiedDate}  onChange={(e) => setModifiedDate(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Modified By</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Modified By" value={modifiedBy}  onChange={(e) => setModifiedBy(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Status</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Status" value={status}  onChange={(e) => setStatus(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        {errorMessage && <div className="text-danger">{errorMessage}</div>}
                                                        <div style={{textAlign:'center'}}>
                                                            <button type="submit" class="btn btn-primary mr-2">Update</button>
                                                        </div>
                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    );
};   

export default EditManageDevice
